root.render(
  <React.StrictMode>
    <div className="absolute top-0 left-0 w-full h-full overflow-hidden bg-black">
      <div className="absolute w-0 h-0 animate-ping absolute -top-1 -left-1 rounded-full bg-red-700 opacity-75"></div>
      <div className="absolute w-0 h-0 animate-ping absolute -bottom-6 -right-2 rounded-full bg-red-700 opacity-75"></div>
      <div className="absolute w-0 h-0 animate-ping absolute -top-10 right-4 rounded-full bg-black opacity-75"></div>
      <div className="absolute w-0 h-0 animate-ping absolute -bottom-10 -left-10 rounded-full bg-black opacity-75"></div>
    </div>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
